  Reservation in Wyoming from an anemometer as part of the Native American anemometer
  loan program. Monthly mean wind speed is available for 2002 through 2003, as is
  wind direction and turbulence data. Data is reported from a height of 20 m. The
  data was originally made available by Wind Powering America, a DOE Office of Energy
  Efficiency & Renewable Energy (EERE) program. A dynamic map displaying all available
  data from DOE anemometer loan programs is available http://www.windpoweringamerica.gov/anemometerloans/projects.asp.\",\n\t\"license_title\":
